    "Bowhead (Balaena mysticetus) and beluga (Delphinapterus leucas) whales in the
    Bering, Chukchi and Beaufort Seas: Annual report",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:01:55.274627",nt"name": "bowhead-balaena-mysticetus-and-beluga-delphinapterus-leucas-whales-in-the-bering-chukchi-a",nt"isopen":
    false,nt"url": null,nt"notes": "Reproductive activity in the bowhead whale
    was observed in early May near Pt. Barrow Alaska, indicating that this species may
    calf and breed during the northward migration. Bowheads congregate in an area near
    shore during September for reasons that are not yet clear. The region from Smith
    Bay to Pt. Barrow should be off limits to any exploration until the area can be
    further studied. A hypothesis is proposed that an unknown segment of the bowhead
    whale population migrates north past Pt. Barrow in the spring and continues north
    to Banks Island, Canada, before entering the southeast Beaufort Sea, rather than
    migrating east in near shore leads along the north coast of Alaska. Circumstantial
    evidence is offered which supports this hypothesis. We have evidence to indicate
    that beluga whales may not be as ice limited as first thought, as sightings have
    placed animals deep in the spring and summer pack ice. Also, numerous hummocks in
    thin ice (made by belugas) have been observed indicating that (directional) movement
    occurs under the ice. Contract no. R7120807, research unit 69, period 1 April 1976
    to 31 March 1977.",nt"license_title": "License Not Specified",nt"extras":
